function clearOverlays(o){for(var e;e=o.pop();)e.setMap(null)}function dragendLocation(o){google.maps.event.addListener(o,"dragend",function(){var e=o.getPosition().lat(),t=o.getPosition().lng(),n=new google.maps.LatLng(e,t);$("#RecordCommentLongitude").val(t),$("#RecordCommentLatitude").val(e),geocoder=new google.maps.Geocoder,geocoder.geocode({latLng:n},function(o,e){e==google.maps.GeocoderStatus.OK?o[0]?$("#RecordCommentAddress").val(o[0].formatted_address):alert("没找到地址"):alert("Geocoder failed due to: "+e)})})}